import React from 'react';
import {
    ContactMeWrapper,
    EmailHeader,
    Email,
    EmailWrapper
} from "./ContactMeElements"

const ContactMeForm = () => {
    return (
        <>
            <>
                <ContactMeWrapper>
                    <EmailHeader>The best place to contact me is at the email below! Please be sure to include your name, email, and reason for contacting me in the email! Thanks!</EmailHeader>
                    <EmailWrapper>
                        <Email>crosenberg8@gatech.edu</Email>
                    </EmailWrapper>
                </ContactMeWrapper>
            </>
        </>
    )
}

export default ContactMeForm;
